      "full_text" : "Every kid with internet will happen across pr0n at some point. When I did, it was like a bomb that was really a dud. Nothing, no reaction. I started thinking I was broken. “Isn’t this the stuff people get addicted to? What’s the deal? Am I not capable of emotion?”",
